import {
  FETCH_FAVORITES_STREAMS,
  FETCH_STREAMS_FAVORITE_SUCCESS,
} from './constants';

export function fetchFavoriteStreams(payload) {
  return {
    type: FETCH_FAVORITES_STREAMS,
    payload: payload,
  };
}

export function fetchFavoriteStreamsSuccess(streams) {
  return {
    type: FETCH_STREAMS_FAVORITE_SUCCESS,
    list: streams,
  };
}
